import Layout from "./Layout";

export default function App(){





  return(
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Layout />}>
          <Route index element={<PageComponent />}/>
          <Route path="ChooseGamemode" element={<ChooseGamemode />}/>


        </Route>
      </Routes>
    </BrowserRouter>
  )
}
